import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Home, MessageCircle, Calendar, Gift, Phone, MapPin } from 'lucide-react';

const RichMenu = () => {
  const navigate = useNavigate();

  const menuItems = [
    {
      id: 1,
      icon: Home,
      label: 'ホーム',
      color: 'bg-primary-600',
      action: () => navigate('/patient/home')
    },
    {
      id: 2,
      icon: MessageCircle,
      label: 'AI相談',
      color: 'bg-purple-600',
      action: () => navigate('/patient/chat')
    },
    {
      id: 3,
      icon: Calendar,
      label: '予約',
      color: 'bg-green-600',
      action: () => alert('予約機能（開発予定）')
    },
    {
      id: 4,
      icon: Gift,
      label: '特典',
      color: 'bg-orange-600',
      action: () => navigate('/patient/home')
    },
    {
      id: 5,
      icon: Phone,
      label: '電話',
      color: 'bg-red-600',
      action: () => alert('TEL: 092-123-4567')
    },
    {
      id: 6,
      icon: MapPin,
      label: 'アクセス',
      color: 'bg-blue-600',
      action: () => alert('アクセス情報（開発予定）')
    }
  ];

  return (
    <div className="liff-container">
      {/* LINEトーク風ヘッダー */}
      <div className="bg-white border-b border-gray-200 p-4">
        <div className="flex items-center">
          <div className="w-10 h-10 bg-primary-600 rounded-full flex items-center justify-center mr-3">
            <span className="text-white font-bold text-sm">歯</span>
          </div>
          <div>
            <h1 className="font-semibold text-gray-800">はち歯科医院</h1>
            <p className="text-sm text-green-600">オンライン</p>
          </div>
        </div>
      </div>

      {/* トーク履歴風 */}
      <div className="p-4 space-y-4 bg-gray-50 min-h-96">
        <div className="flex">
          <div className="bg-white rounded-lg p-3 max-w-xs shadow-sm">
            <p className="text-sm text-gray-800">
              歯知式サブスクリプションサービスへようこそ！<br />
              下のメニューからご利用ください。
            </p>
            <p className="text-xs text-gray-500 mt-1">14:30</p>
          </div>
        </div>

        <div className="flex justify-end">
          <div className="bg-primary-600 text-white rounded-lg p-3 max-w-xs">
            <p className="text-sm">ありがとうございます！</p>
            <p className="text-xs text-primary-200 mt-1">14:31</p>
          </div>
        </div>
      </div>

      {/* リッチメニュー */}
      <div className="bg-white border-t border-gray-200">
        <div className="grid grid-cols-3 gap-0">
          {menuItems.map((item) => {
            const IconComponent = item.icon;
            return (
              <button
                key={item.id}
                onClick={item.action}
                className={`${item.color} text-white p-6 flex flex-col items-center justify-center hover:opacity-90 transition-opacity`}
              >
                <IconComponent className="w-8 h-8 mb-2" />
                <span className="text-sm font-medium">{item.label}</span>
              </button>
            );
          })}
        </div>
      </div>

      {/* LINEメッセージ入力風 */}
      <div className="bg-white border-t border-gray-200 p-3">
        <div className="flex items-center space-x-2">
          <div className="flex-1 bg-gray-100 rounded-full px-4 py-2">
            <span className="text-gray-500 text-sm">メッセージを入力</span>
          </div>
          <button className="bg-primary-600 text-white p-2 rounded-full">
            <MessageCircle className="w-5 h-5" />
          </button>
        </div>
      </div>
    </div>
  );
};

export default RichMenu;
